import { img, section } from 'framer-motion/client';
import React, { useState } from 'react';
import { FaHandshake, FaGlobeAfrica, FaChartLine, FaUsers, FaLightbulb } from 'react-icons/fa';

const PartnersSection = () => {

    <section className="partners-section bg-white rounded-xl shadow-lg gradient-border mb-20 p-8">
        img src="/image/partners.png" alt="Partners" className="w-full h-64 object-cover rounded-xl mb-6" />
        <h2 className="text-3xl font-bold text-dark mb-4">
            Our Partners
        </h2>
        <p className="text-gray-600 mb-6">
            We collaborate with a diverse range of partners to drive innovation and create impactful solutions.
        </p>
    </section>
};

export default PartnersSection;
